            'BIG BANG cuối cùng đã tiết lộ cả 6 ca khúc trong mini album thứ 5 của nhóm, “Alive”. Họ cũng phát hành MV đầy đủ cho ca khúc chủ đề thứ 2, “Bad Boy.”\r\n\r\nNhư thông báo trước đó, BIG BANG sẽ quảng bá cả 6 ca khúc này như ca khúc chủ đề. Sau “Blue” đã được phát hành vào ngày 22 tháng 2, BIG BANG được mong đợi sẽ quảng bá “Bad Boy” như ca khúc chủ đề tiếp theo. Các ca khúc còn lại “Love Dust,” “Ain’t No Fun,” “Fantastic Baby,” và “Wings,” sẽ được quảng bá vào những ngày sau đó.\r\n\r\nLàm việc với Teddy (hitmaker ruột của nhóm), G-Dragon đã sáng tác tất cả các lời bài hát mới nằm trong mini album thứ 5 của BIGBANG "Alive", phát hành vào 29/2/2012, với 260.000 bản đc đặt hàng trước. "Wings" - ca khúc solo của thành viên DaeSung do chính anh đồng viết với G-Dragon. Ca khúc chủ đề "Blue" chưa đầy một giờ sau khi phát hành vào 22/2/2012, đạt "all-kill", tức là #1 trên hơn 7 BXH âm nhạc tại Hàn Quốc như Melon, Naver và Nate. Trên Youtube, nó đạt 2 triệu lượt xem trong vòng 24 giờ',
